contract XSushiStrategyMainnet is XSushiStrategy {

  // token addresses
  address public __sushi = address(0x6B3595068778DD592e39A122f4f5a5cF09C90fE2);
  address public __xsushi = address(0x8798249c2E607446EfB7Ad49eC89dD1865Ff4272);
